DROP TABLE IF EXISTS pacientes CASCADE;
DROP TABLE IF EXISTS identificaciones CASCADE;
DROP TABLE IF EXISTS municipios CASCADE;
DROP TABLE IF EXISTS estados CASCADE;

CREATE TABLE estados( 
estado_id serial PRIMARY KEY, 
estado_nombre varying(200) UNIQUE
);
CREATE TABLE municipios( 
municipio_id serial PRIMARY KEY, 
municipio_nombre varying(200) UNIQUE, 
municipio_nick varying(200),
municipio_estado varying(200) REFERENCES estados (estado_nombre), 
);
CREATE TABLE identificaciones( 
identificacion_id serial PRIMARY KEY, 
identificacion_nombre varying(200) UNIQUE
);

CREATE TABLE pacientes( 
paciente_id serial PRIMARY KEY, 
paciente_nombre varying(200), 
paciente_apellidop varying(200), 
paciente_apellidom varying(200), 
paciente_nacimiento date, 
paciente_rfc varying(13) UNIQUE, 
paciente_curp varying(18) UNIQUE, 
paciente_identificacion varying(200) REFERENCES identificaciones (identificacion_nombre), 
paciente_identificacion_num varying(200), 
paciente_domicilio text, 
paciente_estado varying(200) REFERENCES estados (estado_nombre), 
paciente_municipio varying(200) REFERENCES municipios (municipio_nombre), 
paciente_celular varying(10), 
paciente_activo boolean DEFAULT true
);

















